    const { t, i18n } = useTranslation();

      return (
        <div className="AboutUs" style={{padding: '30px', marginTop:'20px'}}>
          <div style={{ display: 'flex', alignItems: 'flex-start',color: '#F24E1E', padding: '10px' }}>
            <div>{t('About Us')}</div>
          </div>
          <div style={{ display: 'flex', alignItems: 'flex-start' }}>
            <div>Second Row - Left</div>
          </div>
          <div style={{ display: 'flex' }}>
            <div style={{ flex: 1 }}>Third Row - Column 1</div>
            <div style={{ flex: 1 }}>Third Row - Column 2</div>
          </div>
        </div>
      );
  
    
      }
